import React from 'react';
import { Button } from 'antd';
import { Link, useNavigate } from 'react-router-dom';

const Admin = () => {
  const navigate = useNavigate();

  const handleAddProperty = () => {
    navigate('/property-input'); // Ev ekleme sayfasına yönlendirir
  };

  return (
    <div style={{ padding: '50px', textAlign: 'center' }}>
      <h1>Admin Paneli</h1>
      <Button type="primary" onClick={handleAddProperty} style={{ marginTop: '20px' }}>
        Ev Ekle
      </Button>
      <div style={{ marginTop: '20px' }}>
        <Link to="/">Ana Sayfa</Link>
        <Link to="/contact" style={{ marginLeft: '10px' }}>İletişim</Link>
        <Link to="/about-us" style={{ marginLeft: '10px' }}>Hakkımızda</Link>
      </div>
    </div>
  );
};

export default Admin;
